(2, '五星复式', 1, 1, 196000.00, 170000.00, 5, 1, '从万位、千位、百位、十位、个位各选一个号码组成一注。', '从万位、千位、百位、十位、个位中选择一个5位数号码组成一注，所选号码与开奖号码全部相同，且顺序一致，即为中奖。', '投注方案：12345，开奖号码：12345，即中五星直选', 'dxwf5f', 'ssc5xfs', 'fs', 'ssc', 1, 1, 0, 100000, 100000),
(3, '五星单式', 1, 1, 196000.00, 170000.00, 5, 1, '手动输入号码，至少输入1个五位数号码组成一注。', '手动输入一个5位数号码组成一注，所选号码与开奖号码的万位、千位、百位、十位、个位相同，且顺序一致，即为中奖。', '如：输入1234567890，则你投两注分别为12345和67890，如果开奖号为12345，则你中奖一注。', 'dxwf5d', 'ssc5xds', 'ds', 'ssc_dx_5d', 0, 2, 0, 100000, 100000),
(4, '前四复式', 1, 1, 19600.00, 17000.00, 4, 66, '从万位、千位、百位、十位各选一个号码组成一注。', '从万位、千位、百位、十位中选择一个4位数号码组成一注，所选号码与开奖号码前4位相同，且顺序一致，即为中奖。', '投注方案：1234，开奖号码：1234，即中前四直选', 'dxwfQ4f', 'sscqh4xfs', 'fs', 'ssc_dx_q4f', 1, 4, 0, 10000, 10000),
(5, '前四单式', 1, 1, 19600.00, 17000.00, 4, 66, '手动输入号码，至少输入1个四位数号码组成一注。', '手动输入一个4位数号码组成一注，所选号码与开奖号码的万位、千位、百位、十位相同，且顺序一致，即为中奖。', '投注方案：1234，开奖号码：1234，即中前四直选', 'dxwfQ4d', 'qh4ds', 'ds', 'ssc_dx_q4d', 0, 5, 0, 10000, 10000),
(6, '后四复式', 1, 1, 19600.00, 17000.00, 4, 66, '从千位、百位、十位、个位各选一个号码组成一注。', '从千位、百位、十位、个位中选择一个4位数号码组成一注，所选号码与开奖号码相同，且顺序一致，即为中奖。', '投注方案：1234，开奖号码：1234，即中四星直选', 'dxwfH4f', 'sscqh4xfs', 'fs', 'ssc_dx_h4f', 1, 6, 0, 10000, 10000),
(7, '后四单式', 1, 1, 19600.00, 17000.00, 4, 66, '手动输入号码，至少输入一个四位数号码组成一注。', '手动输入一个4位数号码组成一注，所选号码与开奖号码的千位、百位、十位、个位相同，且顺序一致，即为中奖。', '投注方案：1234，开奖号码：1234，即中四星直选。', 'dxwfH4d', 'qh4ds', 'ds', 'ssc_dx_q4d', 0, 7, 0, 10000, 10000),
(8, '任四复式', 1, 1, 19600.00, 17000.00, 4, 76, '从万位、千位、百位、十位、个位中选择四位各选1个号码组成一注。', '从万位、千位、百位、十位、个位中选择四位各选1个号码组成一注，所选号码与开奖号码的指定位置上的号码相同，且顺序一致，即为中奖。', '投注方案：万位选1，百位选2，十位选3，个位选4。开奖号码：12234，即中任四直选。', 'dxwfR4f', 'rx4fs', 'fs', 'ssc_dx_r4f', 1, 7, 0, 10000, 10000),
(9, '任四单式', 1, 1, 19600.00, 17000.00, 4, 76, '从万位、千位、百位、十位、个位中选择四个位置，至少手动输入一个四位数的号码组成一注。', ' 从万位、千位、百位、十位、个位中选择四个位置。至少手动输入一个四位数的号码组成一注，所选号码与开奖号码的指定位置上的号码相同，且顺序一致，即为中奖。', '投注方案：万位选1，百位选2，十位选3，个位选4。开奖号码：12234，即中任四直选。1*345，则为中奖，如果是13*45或134*5等都不中奖。', 'dxwfR4d', 'rx4ds', 'ds', 'ssc_dx_r4d', 0, 8, 0, 10000, 10000),
(10, '前三复式', 1, 1, 1960.00, 1700.00, 3, 2, '从万位、千位、百位各选一个号码组成一注。', '从万位、千位、百位中选择一个三位数号码组成一注，所选号码与开奖号码前三位相同，且顺序一致，即为中奖。', '投注方案：123，开奖号码：前三位123，即中前三直选。', 'sxwfQ3f', 'sscqzh3xfs', 'fs', 'ssc_3x_q3f', 1, 0, 0, 1000, 1000),
(11, '前三单式', 1, 1, 1960.00, 1700.00, 3, 2, '手动输入号码，至少输入1个三位数号码组成一注。', '手动输入一个3位数号码组成一注，所选号码与开奖号码的前三位相同，且顺序一致，即为中奖！', '投注方案：123，开奖号码：前三位123，即中前三直选。', 'sxwfQ3d', 'qzh3ds', 'ds', 'ssc_3x_q3d', 0, 1, 0, 1000, 1000),
(12, '后三复式', 1, 1, 1960.00, 1700.00, 3, 2, '从百位、十位、个位各选一个号码组成一注。', '从百位、十位、个位中选择一个三位数号码组成一注，所选号码与开奖号码后三位相同，且顺序一致，即为中奖。', '投注方案：123，开奖号码：后三位123，即中后三直选。', 'sxwfH3f', 'sscqzh3xfs', 'fs', 'ssc_3x_h3f', 1, 5, 0, 1000, 1000),
(13, '后三单式', 1, 1, 1960.00, 1700.00, 3, 2, '手动输入号码，至少输入1个三位数号码组成一注。', '手动输入一个3位数号码组成一注，所选号码与开奖号码的后三位相同，且顺序一致，即为中奖！', '投注方案：123，开奖号码：后三位123，即中后三直选。', 'sxwfH3d', 'qzh3ds', 'ds', 'ssc_3x_q3d', 0, 6, 0, 1000, 1000),
(14, '任三复式', 1, 1, 1960.00, 1700.00, 3, 76, '从万位、千位、百位、十位、个位中选择三位各选1个号码组成一注。', '从万位、千位、百位、十位、个位中选择三位各选1个号码组成一注，所选号码与开奖号码的指定位置上的号码相同，且顺序一致，即为中奖。', '投注方案：万位选1，百位选2，个位选3。开奖号码：12223，即中任三直选。', 'sxwfR3f', 'rx3fs', 'fs', 'ssc_3x_r3f', 1, 2, 0, 1000, 1000),
(15, '任三单式', 1, 1, 1960.00, 1700.00, 3, 76, '从万位、千位、百位、十位、个位中选择三个位置，至少手动输入一个三位数的号码组成一注。', '从万位、千位、百位、十位、个位中选择三个位置。至少手动输入一个三位数的号码组成一注，所选号码与开奖号码的指定位置上的号码相同，且顺序一致，即为中奖。', '投注方案：选择万位、百位、个位，输入号码123。开奖号码：12223，即中任三直选。', 'sxwfR3d', 'rx3ds', 'ds', 'ssc_3x_r3d', 0, 3, 0, 1000, 1000),
(16, '前三组三', 1, 1, 653.00, 578.00, 2, 3, '从0-9中任意选择2个或2个以上号码。', '从0-9中选择2个或者2个以上数字组成两注或两注以上，所选号码与开奖号码前三位相同，顺序不限，即为中奖。', '投注方案：122  开奖号码：前三位221(顺序不限)，即中前三组选三', 'sxzxQ3z3', 'rx3z3', 'fs', 'ssc_z3_q3', 1, 0, 0, 1000, 1000),
(17, '前三组六', 1, 1, 326.00, 289.00, 3, 3, '从0-9中任意选择3个或3个以上号码。', '从0-9中选择3个或者3个以上数字组成1注或1注以上，所选号码与开奖号码前三位相同，顺序不限，即为中奖。', '投注方案：135   开奖号码：前三位513(顺序不限)，即中前三组选六。', 'sxzxQ3z6', 'rx3z6', 'fs', 'ssc_z3_q6', 1, 1, 0, 1000, 1000),
(18, '前三混合组选', 1, 1, 60.00, 55.00, 3, 3, '手动输入号码，至少输入1个三位数号码。', '手动输入一个3位数号码组成一注（不含豹子号），开奖号码的前三位符合手动输入号码，即中前三组选三或前三组选六。', '投注方案：122、135。  开奖号码：前三位221(顺序不限)即中前三组选三，或前三位513(顺序不限)即中前三组选六。', 'sxzxQ3h', '', 'ds', 'ssc_3x_z3q', 0, 2, 0, 1000, 1000),
